import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

const FilteriEkran = (props) => {
  return (
    <View style={stil.ekran}>
      <Text>filteri. </Text>
    </View>
  );
}

const stil = StyleSheet.create({
  ekran: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});

export default FilteriEkran
